import { createMuiTheme } from '@material-ui/core/styles';
import { blue, green } from '@material-ui/core/colors'

const theme = createMuiTheme({
    paletter: {
        type: 'dark',
        primary: {
            main: blue[900],
        },
        seconday: {
            main: green[500],
        },
    },
});

export default theme;
